INSERT INTO `quest` VALUES (1,2,0,'Обход','Здравствуй, ты тут новичок и тебе нужно познакомится с местными жителями. Сейчас иди к торговцу оружием.',0,0,0,10,0,3,4),(2,3,0,'Обход','Можешь отправляться к оружейному мастеру, он находится севернее от меня.',0,0,0,10,1,4,10),(3,4,0,'Обход','Теперь отправляйся к торговцу боеприпасами, он рядом с торговцем оружием.',0,0,0,10,2,10,8),(4,5,0,'Обход','Отправляйся к торговцу вещами, он даст тебе обмундирование. Торговец вещами в юге от меня.',0,0,0,10,3,8,5),(5,6,0,'Обход','Теперь иди к торговцу медикаментами.',0,0,0,10,4,5,6),(6,7,0,'Обход','Отправляйся к учителю, он в севере от меня.',0,0,0,10,5,6,11),(7,0,0,'Обход','Возвращайся к мэру.',10,100,0,10,6,11,3),(8,0,2,'Клешни','Мне срочно нужны клешни скорпионов! И не спрашивай зачем, просто достань их!',10,50,0,10,0,7,7),(9,0,2,'Хвосты','Волков пришло слишком много, нужно истреблять их. Иди и отстреляй их, в доказательство принеси десяток хвостов. Волки находятся на юге. М, по дороге убей пару скорпионов и принеси их клешни.',19,110,1,10,0,7,7);
/*!40000 ALTER TABLE `quest` ENABLE KEYS */;

